import React, { Component } from 'react';
import qa from '../images/qa.png'

class Home extends Component {

    render() {
        return (
            <div>
                <p>Question and Answer System Using NLP</p>
                <img className="qa" src={qa}></img>
            </div>

        );
    }
}

export default Home;
